import React, { useState } from "react"
import { Tabs, Tab } from "react-bootstrap"
import { Excel } from "../../components/Excel/Excel"

export const Inicio = () => {
    const [tabs, setTabs] = useState([])
    const newTab = () => {
        setTabs([...tabs, {name: "New Tab"}])
    }

    return <div>
        <button className="btn" onClick={newTab}>aaa</button>
        <Tabs
            defaultActiveKey="home"
            transition={false}
            className="mb-3 m-2"
        >
            {tabs.map(item => <Tab title={item.name}><Excel></Excel></Tab>)}
            <Tab eventKey="home" title="Home">
                <Excel></Excel>
            </Tab>
        </Tabs>
    </div>
}
